import React from 'react';
import EmpData from './DashboardPage.json';

function EmployeeList(props) {

    return (
        <div>
           <h1>Employee List</h1>
           {EmpData.map((empList, index) => {
               return <div> 
               <h1>{empList.user.name}</h1>
               </div>
           })}
     
        </div>
    )
}

export default EmployeeList
